// frontend/src/App.js
import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

// Import components
import Login from './components/auth/Login';
import Register from './components/auth/Register';
import Dashboard from './components/dashboard/Dashboard';
import Equipment from './components/equipment/Equipment';
import Maintenance from './components/maintenance/Maintenance';
import SchedulePreventive from './components/maintenance/SchedulePreventive';
import ReportIssue from './components/maintenance/ReportIssue';
import Tasks from './components/tasks/Tasks';
import Users from './components/users/Users';
import AddEquipment from './components/equipment/AddEquipment';
import AddTask from './components/tasks/AddTask';
import AddUser from './components/users/AddUser';
import Navbar from './components/layout/Navbar';
import Sidebar from './components/layout/Sidebar';
import PrivateRoute from './components/routing/PrivateRoute';

function App() {
  const [user, setUser] = useState(null);

  useEffect(() => {
    const storedUser = localStorage.getItem('user');
    if (storedUser) {
      setUser(JSON.parse(storedUser));
    }
  }, []);

  const login = (userData) => {
    setUser(userData.user);
    localStorage.setItem('user', JSON.stringify(userData.user));
    localStorage.setItem('token', userData.token);
  };

  const logout = () => {
    setUser(null);
    localStorage.removeItem('user');
    localStorage.removeItem('token');
  };

  return (
    <Router>
      <div className="min-h-screen bg-gradient-to-br from-slate-50 via-blue-50 to-teal-50 flex">
        {/* Sidebar */}
        {user && <Sidebar />}

        {/* Main content */}
        <div className="flex-1 flex flex-col">
          {user && <Navbar logout={logout} />}

          <main className="flex-1 p-4">
            <Routes>
              {/* Public routes */}
              <Route path="/login" element={<Login login={login} />} />
              <Route path="/register" element={<Register />} />

              {/* Protected routes */}
              <Route
                path="/dashboard"
                element={
                  <PrivateRoute user={user}>
                    <Dashboard />
                  </PrivateRoute>
                }
              />
              <Route
                path="/equipment"
                element={
                  <PrivateRoute user={user}>
                    <Equipment />
                  </PrivateRoute>
                }
              />
              <Route
                path="/maintenance"
                element={
                  <PrivateRoute user={user}>
                    <Maintenance />
                  </PrivateRoute>
                }
              />
              <Route
                path="/schedule-preventive"
                element={
                  <PrivateRoute user={user}>
                    <SchedulePreventive />
                  </PrivateRoute>
                }
              />
              <Route
                path="/report-issue"
                element={
                  <PrivateRoute user={user}>
                    <ReportIssue />
                  </PrivateRoute>
                }
              />
              <Route
                path="/tasks"
                element={
                  <PrivateRoute user={user}>
                    <Tasks />
                  </PrivateRoute>
                }
              />
              <Route
                path="/users"
                element={
                  <PrivateRoute user={user}>
                    <Users />
                  </PrivateRoute>
                }
              />
              <Route
                path="/equipment/add"
                element={
                  <PrivateRoute user={user}>
                    <AddEquipment />
                  </PrivateRoute>
                }
              />
              <Route
                path="/tasks/add"
                element={
                  <PrivateRoute user={user}>
                    <AddTask />
                  </PrivateRoute>
                }
              />
              <Route
                path="/users/add"
                element={
                  <PrivateRoute user={user}>
                    <AddUser />
                  </PrivateRoute>
                }
              />

              {/* Default redirect */}
              <Route path="/" element={<Navigate to="/dashboard" replace />} />
            </Routes>
          </main>
        </div>
      </div>
    </Router>
  );
}

export default App;
